import React from "react";

const Contact = () => {
  return (
    <div className="contact">
      <form onSubmit={this.handleSubmit}>
        <label>
          Nom :
          <input
            type="text"
            value={this.state.value}
            onChange={this.handleChange}
          />
        </label>
        <input type="submit" value="Envoyer" />
      </form>
    </div>
  );
};

export default Contact;
